import React from 'react';
import nikklaus from './nikklaus.jpg'
const Posts = () => {
    return (
   
          <div>
    <Avatar src={nikklaus} style={{width:'60px',height:'60px',marginLeft:'20px'}}/>       
    <input style={{marginLeft:'20px',width:'300px', border:'red', borderRadius:'99px', paddingLeft:'30px'}} type="text" placeholder="What's on your mind dawg?"/>

   
    </div>

     );
}
 
export default Posts;
